INSERT INTO `decretos` (`id_decreto`, `numero_ley`, `texto_decreto`, `enlace_decreto`) VALUES
(1, 4, 'Se derogan los art&iacute;culos 259 Bis, 259 Ter, 259 Quater, 259 Quinquies, 259 Sexies, 259 Septies y 259 Octies por el Art&iacute;culo Transitorio D&eacute;cimo de la Ley 310 del Sistema Estatal de Seguridad P&uacute;blica para el Estado de Veracruz de Ignacio de la Llave, publicada en la Gaceta Oficial n&uacute;mero 476 Extraordinario de fecha 28 de Noviembre de 2014.', ''),
(2, 7, 'DECRETO 297; G.O.E., No. Ext.362 del 10/IX/2014. Art&iacute;culo Cuarto.- Iniciada la vigencia del C&oacute;digo Nacional de Procedimientos Penales en todo el Estado de Veracruz de Ignacio de la Llave, quedar&aacute;n abrogados los C&oacute;digos de Procedimientos penales anteriores,sin embargo,respecto de los procedimientos penales que a la entrada en vigor de dicho ordenamiento se encuentre en tr&aacute;mite, continuar&aacute;n su substanciaci&oacute;n de conformidad con la legislaci&oacute;n aplicable en el momento del inicio de los mismos.', 'pdf_ult/Decreto297.pdf'),
(5, 58, 'Ley de Ejecución de Sanciones para el Estado de Veracruz Llave (Número 350)', 'pdf/55a.pdf'),
(4, 8, 'DECRETO 297; G.O.E., No. Ext.362 del 10/IX/2014. Art&iacute;culo Cuarto.- Iniciada la vigencia del C&oacute;digo Nacional de Procedimientos Penales en todo el Estado de Veracruz de Ignacio de la Llave, quedar&aacute;n abrogados los C&oacute;digos de Procedimientos penales anteriores,sin embargo,respecto de los procedimientos penales que a la entrada en vigor de dicho ordenamiento se encuentre en tr&aacute;mite, continuar&aacute;n su substanciaci&oacute;n de conformidad con la legislaci&oacute;n aplicable en el momento del inicio de los mismos.', 'pdf_ult/Decreto297.pdf'),
(6, 58, 'Ley de Ejecución de Sanciones y Reinserción Social para el Estado de Veracruz de Ignacio de la Llave (Número 573)', 'pdf/55b.pdf'),
(7, 58, 'Para su vigencia y aplicación, consúltese los artículos Transitorios de la Ley Nacional', 'pdf/55tran.pdf'),
(8, 61, 'Nota: En tanto se realizan las adecuaciones conducentes a la Ley Org&aacute;nica del Poder Judicial del Estado Libre y Soberano de Veracruz de Ignacio de la Llave, el Pleno del Tribunal Superior de Justicia determinar&aacute; cu&aacute;les ser&aacute;n los juzgados competentes para los procedimientos a los que se refiere la presente Ley.', ''),
(9, 73, 'Nota: Será; aplicada hasta la sustanciación de los asuntos en trámite en materia penal.', ''),
(10, 88, 'Ley de Responsabilidad Juvenil para el Estado de Veracruz de Ignacio de la Llave (Número 587)', 'pdf/84a.pdf'),
(11, 88, 'Para su vigencia y aplicación consúltese los artículos Transitorios de la Ley Nacional', 'pdf/84tran.pdf'),
(12, 92, 'Nota: Se deroga la Ley número 589 de Tránsito y Transporte para el Estado de Veracruz de Ignacio de la Llave, publicada en la Gaceta Oficial del Estado de Veracruz el día lunes 6 de Noviembre de 2006, excepto su Título Tercero y démas disposiciones relativas a la materia de transporte público, en tanto se emite la Ley correspondiente (Transitorio Segundo).', 'pdf/ley87.pdf'),
(13, 104, 'Ver Transitorios Segundo y Cuarto de la Ley 585', 'pdf_ult/101.pdf'),
(14, 113, 'Ley Abrogada de fecha 24 Junio 2009 (ver transitorios tercero y sexto de la ley Número 310)', 'pdf_ult/110abrogada.pdf'),
(15, 125, 'Nota: La presente Ley entrará en vigor en la medida en que lo haga el Código Nacional de Procedimientos Penales en el Estado de Veracruz de Ignacio de la Llave, de conformidad con la declaratoria correspondiente, aprobada meidante el Decreto número 297, publicado el 10 de septiembre de 2014 en la Gaceta Oficial del Estado.', '');
